import React, { useContext, useEffect } from 'react'
import NoteContext from "../Constaxt/notes/noteContext"
import Noteitem from "../Componants/Noteitem"

const Note = () => {
    const context = useContext(NoteContext);
    const {notes , getallnotes} = context;
    useEffect(() => {
      getallnotes()
     
    }, [])
    
  return (
 <>
 <Addnote/>
    <div className="row ">
      <h1>Your Notes</h1>
      { 
        notes.map((note)=>{
            return <li  key={note._id}><Noteitem note={note}/></li>
        })
      }
      </div>
      </>
)
}

export default Note
